// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract TokenContract {
    address private _owner;
    uint256 public maxTxAmount;
    uint256 public maxWalletSize;
    bool public transferDelayEnabled;

    event MaxTxAmountUpdated(uint256 newMaxTxAmount);
    event MaxWalletSizeUpdated(uint256 newMaxWalletSize);

    modifier onlyOwner() {
        require(msg.sender == _owner, "Ownable: caller is not the owner");
        _;
    }

    constructor() {
        _owner = msg.sender;
        maxTxAmount = 1_000_000_000; // Example initial value
        maxWalletSize = 1_000_000_000; // Example initial value
        transferDelayEnabled = false;
    }

    function removeLimits() external onlyOwner {
        maxTxAmount = type(uint256).max; // Set to maximum possible value
        maxWalletSize = type(uint256).max; // Set to maximum possible value
        transferDelayEnabled = false; // Disable transfer delay

        emit MaxTxAmountUpdated(maxTxAmount);
        emit MaxWalletSizeUpdated(maxWalletSize);
    }
}
```

### Explanation of Changes:
1. **Owner Check**: The `onlyOwner` modifier is used to simplify the ownership check logic.
2. **Variable Names**: Replaced ambiguous variable names like `var_a`, `var_b`, etc., with meaningful names such as `maxTxAmount`, `maxWalletSize`, and `transferDelayEnabled`.
3. **Events**: Added events `MaxTxAmountUpdated` and `MaxWalletSizeUpdated` to log changes to the respective limits.
4. **Constants**: Used `type(uint256).max` to represent the maximum possible value for `maxTxAmount` and `maxWalletSize`.
5. **Constructor**: Added a constructor to initialize the owner and set default values for `maxTxAmount`, `maxWalletSize`, and `transferDelayEnabled`.
6. **Readability**: Removed unnecessary nested conditions and redundant code to make the function clean and readable.

This refactored code is now concise, functional, and adheres to Solidity best practices.

